import React from 'react';

const Form = () => {
  return (
    <form>
      <div>
        <p>
          <label>Username</label>
          <input />
        </p>
        <p>
          <label>Age (years)</label>
        </p>
      </div>
    </form>
  )
}

function App() {
  return (
    <div>
      <Form />
    </div>
  );
}

export default App;
